import React from 'react';
import { users } from 'data/users';
import UsersListItem from 'components/molecules/UsersListItem/UsersListItem';
import { StyledList, Wrapper } from './UsersList.styles';

class UsersList extends React.Component {
  state = {
    isUsersList: true,
  };

  render() {
    return (
      <Wrapper>
        <h1>{this.state.isListTitle}</h1>
        <button onClick={() => this.setState({ isUsersList: 'Students list' })}>Change title </button>
        <StyledList>
          {users.map((userData, i) => (
            <UsersListItem index={i} key={userData.name} userData={userData} />
          ))}
        </StyledList>
      </Wrapper>
    );
  }
}
export default UsersList;
